import React from 'react';
import profileStyles from './Profile.module.css';
import Counter from './Counter';
import Button from './Button';




function Profile() {
  return (
    <div className={profileStyles.profileCard}>
        <img src="../../../img/profilephoto.jpeg" alt="profile" className={profileStyles.profilePhoto}/>
        <Counter initValue="2000" initText="Follower(s)" />
        <Button changeValue={this.changeCounterValue} innerText="Follow" />
    </div>
  );
}

export default Profile;
